import React, { useEffect, useState } from 'react';
import Fonts from './fonts.json'
import './App.css';
import FontSelector from './FontSelector';

/**
 * 読み込むフォント
 */
const fontList = Fonts;

const Main = () => {
  const [font, setFont] = useState({
    name: '',
    style: '',
  });

  const [text] = useState('');

  useEffect(() => {
    console.log(font);
  }, [font]);

  return (
    <div className="App-header">
      <textarea value={text}/>
      <FontSelector fonts={fontList} onChange={setFont}/>
    </div>
  );
}

const App = () => {
  return (
    <div className="main">
      <Main />
    </div>
  );
}

export default App;
